import React, { Component } from 'react';


class Counter extends Component {

    state = {
        count: 0
    };

    formatCount(){
        if(this.state.count==0){
            return ('Zero');
        }
    }

    render() { 
        return (
        <React.Fragment>
            <span>{this.formatCount()}</span>
            <button>Increase</button>
        </React.Fragment>
        );
    }
}

export default Counter;
